export default function Product() {
  return (
    <Card className="my-3 p-3 rounded" border="">
      <Card.Img
        src={
          "https://blog.prestigeflowers.co.uk/wp-content/uploads/sites/2/2016/09/NF1015_3.jpg"
        }
      ></Card.Img>
      <Card.Body>
        <Card.Title>Title</Card.Title>
        <Card.Text>Text</Card.Text>
      </Card.Body>
    </Card>
  );
}
